import React from "react";

const Overview = ({ quoteResponse }) => {
  return (
    <div className="row">
      <div className="col-6">
        <div className="text-primary">
          {quoteResponse &&
            quoteResponse?.quoteResponse.result[0].symbol.replace(".BK", "")}
        </div>
        <div>
          {quoteResponse && quoteResponse?.quoteResponse.result[0].longName}
        </div>
      </div>
      <div className="col-2"></div>
      <div className="col-2"></div>
      <div className="col-2"></div>
    </div>
  );
};

export default Overview;
